import regice from './assets/regice.png';
import video from './assets/video-bg.mov';
import './App.css';

export default function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      <Regice />
      <Video />
    </div>
  );
}

function Regice() {
  return (
    <img src={regice} width="300px" />
  );
}

function Video() {
  return (
    <video src={video} width="1000px" autoplay />
  );
}
